import classes from './AboutTheCourse.module.css';
import {BsArrowDown} from 'react-icons/bs';


const AboutTheCourse =()=>{

return (

<div className={classes.aboutTheCourse}>

   <i> About the Course:  <button> <BsArrowDown/>  </button> </i>


   <div className={classes.aboutTheCourseText}> 


     <p>Classical mechanics is a physical theory describing the motion of macroscopic objects, from projectiles to parts of machinery, and astronomical objects, such as spacecraft, planets, stars, and galaxies. For objects governed by classical mechanics, if the present state is known, it is possible to predict how it will move in the future (determinism), and how it has moved in the past (reversibility).
    </p>


   </div>
</div>

);

}

export default AboutTheCourse;
